package com.example.schooladmin.model;public class Teacher {    private int id;    private String name;    private String password;    private int subjectID;    private String subjectName;    public Teacher(int id, String name, String password, int subjectID) {        this.id = id;        this.name = name;        this.password = password;        this.subjectID = subjectID;    }    public Teacher(int id, String name, String subjectName) {        this.id = id;        this.name = name;        this.subjectName = subjectName;    }    public Teacher(int id, String name, String password, String subjectName) {        this.id = id;        this.name = name;        this.password = password;        this.subjectName = subjectName;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public int getSubjectID() {        return subjectID;    }    public void setSubjectID(int subjectID) {        this.subjectID = subjectID;    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getSubjectName() {        return subjectName;    }    public void setSubjectName(String subjectName) {        this.subjectName = subjectName;    }}